import React, { useState } from 'react';

const AddTaskForm = () => {
    const [task, setTask] = useState({
        title: '',
        description: '',
        dueDate: '',
        priority: 'Medium',
        status: 'Not Started',
        tags: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setTask(prevTask => ({ ...prevTask, [name]: value }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Submitting', task);

        // Here you would typically send the data to the backend
        // Reset form fields
        setTask({
            title: '',
            description: '',
            dueDate: '',
            priority: 'Medium',
            status: 'Not Started',
            tags: ''
        });
    };

    return (
        <form onSubmit={handleSubmit} style={{ margin: '20px', maxWidth: '500px' }}>
            <h2 style={{ textAlign: 'center' }}>Add a New Task</h2>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="title">Title:</label>
                <input
                    type="text"
                    id="title"
                    name="title"
                    value={task.title}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                    required
                />
            </div>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="description">Description:</label>
                <textarea
                    id="description"
                    name="description"
                    value={task.description}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                    required
                />
            </div>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="dueDate">Due Date:</label>
                <input
                    type="date"
                    id="dueDate"
                    name="dueDate"
                    value={task.dueDate}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                />
            </div>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="priority">Priority:</label>
                <select
                    id="priority"
                    name="priority"
                    value={task.priority}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                >
                    <option value="High">High</option>
                    <option value="Medium">Medium</option>
                    <option value="Low">Low</option>
                </select>
            </div>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="status">Status:</label>
                <select
                    id="status"
                    name="status"
                    value={task.status}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                >
                    <option value="Not Started">Not Started</option>
                    <option value="In Progress">In Progress</option>
                    <option value="Completed">Completed</option>
                </select>
            </div>
            <div style={{ marginBottom: '10px' }}>
                <label htmlFor="tags">Tags (comma-separated):</label>
                <input
                    type="text"
                    id="tags"
                    name="tags"
                    value={task.tags}
                    onChange={handleChange}
                    style={{ width: '100%', padding: '8px', margin: '5px 0' }}
                />
            </div>
            <button type="submit" style={{ width: '100%', padding: '10px', backgroundColor: '#4CAF50', color: 'white', fontSize: '16px', cursor: 'pointer' }}>Add Task</button>
        </form>
    );
};

export default AddTaskForm;
